function minimumIndex(nums: number[]): number {
    const n = nums.length;
    let dominant = nums[0], count = 0;

    // Find the dominant element
    for (let i = 0; i < n; ++i) {
        if (nums[i] === dominant) {
            count++;
        } else if (--count === 0) {
            dominant = nums[i];
            count = 1;
        }
    }

    // Count occurrences of the dominant element
    count = nums.reduce((acc, val) => acc + (val === dominant ? 1 : 0), 0);

    // No valid split if the dominant element does not fulfill the criteria globally
    if (count * 2 <= n) return -1;

    let leftCount = 0;
    for (let i = 0; i < n - 1; ++i) {
        leftCount += (nums[i] === dominant ? 1 : 0);
        if (leftCount * 2 > i + 1 && (count - leftCount) * 2 > n - i - 1) {
            return i;
        }
    }

    return -1;
};
